oxy_webhelp_navlinks = {"con_getstarted.dita-d4800e3251":{"topics":[{"title":"What is a directory?","shortdesc":"<p class=\"shortdesc\">A directory is an address book. It contains a list of contacts and their information. When you cannot find a contact, you can search for them in one or more directories.<\/p>","href":"con_directory_c.html","attributes":{"data-id":"domino_directory_c.dita"},"menu":{"hasChildren":false},"tocID":"domino_directory_c.dita-d4800e3262","topics":[]},{"title":"What is a vCard?","shortdesc":"<p class=\"shortdesc\">A vCard contains contact information, such as title, phone numbers, and email addresses. You can use vCards to add someone to your contacts list, or to make it easier for people to add you to their contacts list. You can also use vCards to import or export multiple contacts in one file.<\/p>","href":"con_vcard_c_2.html","attributes":{"data-id":"con_vcard_c.dita"},"menu":{"hasChildren":false},"tocID":"con_vcard_c.dita-d4800e3273","topics":[]},{"title":"Who are my Recent Contacts?","shortdesc":"<p class=\"shortdesc\">When you address an email or a meeting invitation, a list of names and addresses appears as you type. The people in that list are your recent contacts. They are chosen automatically, based on the people with whom you recently emailed, chatted, and had meetings.<\/p>","href":"con_recent_contacts_t.html","attributes":{"data-id":"con_recent_contacts_t.dita"},"menu":{"hasChildren":false},"tocID":"con_recent_contacts_t.dita-d4800e3284","topics":[]},{"title":"How can I use categories in Contacts?","shortdesc":"<p class=\"shortdesc\">Categories are labels that help you organize items and find them more easily. You can use categories to organize calendar entries, to do items, contacts, or groups. You can assign category colors, so entries in a category appear in a different color on your calendar.<\/p>","href":"con_categories_c.html","attributes":{"data-id":"con_categories_c"},"menu":{"hasChildren":false},"tocID":"con_categories_c-d4800e3295","topics":[]},{"title":"How can I find emails, chats, and shared documents with a specific contact?","shortdesc":"<p class=\"shortdesc\">You can view a history of collaborations that you have had with one of your contacts, such as email, chat transcripts (if you have saved them), or shared documents.<\/p>","href":"con_view_collab_history_t.html","attributes":{"data-id":"con_view_collab_history_t"},"menu":{"hasChildren":false},"tocID":"con_view_collab_history_t-d4800e3306","topics":[]}]}};